//------------------------------------------------------------------------------
// MIXINS
//------------------------------------------------------------------------------

@mixin name($name) {
    -webkit-animation-name: $name;
    animation-name: $name;
}

@mixin delay($time) {
    -webkit-animation-delay: $time;
    animation-delay: $time;
}

@mixin bezier($bezier) {
    -webkit-animation-timing-function: $bezier;
    animation-timing-function: $bezier;
}

@mixin transform($transform...) {
    -webkit-transform: $transform;
    transform: $transform;
}

@mixin duration($time) {
    -webkit-animation-duration: $time;
    animation-duration: $time;
}

@mixin transformOrigin($origin) {
    -webkit-transform-origin: $origin;
    transform-origin: $origin;
}

@mixin backFaceVisibility($state) {
    -webkit-backface-visibility: $state;
    backface-visibility: $state;
}

//**********

//------------------------------------------------------------------------------
// EASINGS
//------------------------------------------------------------------------------

// Cubic
$easeInCubic    : cubic-bezier(0.550, 0.055, 0.675, 0.190);
$easeOutCubic   : cubic-bezier(0.215, 0.610, 0.355, 1.000);
$easeInOutCubic : cubic-bezier(0.645, 0.045, 0.355, 1.000);

// Circ
$easeInCirc     : cubic-bezier(0.600, 0.040, 0.980, 0.335);
$easeOutCirc    : cubic-bezier(0.075, 0.820, 0.165, 1.000);
$easeInOutCirc  : cubic-bezier(0.785, 0.135, 0.150, 0.860);

// Expo
$easeInExpo     : cubic-bezier(0.950, 0.050, 0.795, 0.035);
$easeOutExpo    : cubic-bezier(0.190, 1.000, 0.220, 1.000);
$easeInOutExpo  : cubic-bezier(1.000, 0.000, 0.000, 1.000);

// Quad
$easeInQuad     : cubic-bezier(0.550, 0.085, 0.680, 0.530);
$easeOutQuad    : cubic-bezier(0.250, 0.460, 0.450, 0.940);
$easeInOutQuad  : cubic-bezier(0.455, 0.030, 0.515, 0.955);

// Quart
$easeInQuart    : cubic-bezier(0.895, 0.030, 0.685, 0.220);
$easeOutQuart   : cubic-bezier(0.165, 0.840, 0.440, 1.000);
$easeInOutQuart : cubic-bezier(0.770, 0.000, 0.175, 1.000);

// Quint
$easeInQuint    : cubic-bezier(0.755, 0.050, 0.855, 0.060);
$easeOutQuint   : cubic-bezier(0.230, 1.000, 0.320, 1.000);
$easeInOutQuint : cubic-bezier(0.860, 0.000, 0.070, 1.000);

// Sine
$easeInSine     : cubic-bezier(0.470, 0.000, 0.745, 0.715);
$easeOutSine    : cubic-bezier(0.390, 0.575, 0.565, 1.000);
$easeInOutSine  : cubic-bezier(0.445, 0.050, 0.550, 0.950);

// Back
$easeInBack     : cubic-bezier(0.600, -0.280, 0.735, 0.045);
$easeOutBack    : cubic-bezier(0.175,  0.885, 0.320, 1.275);
$easeInOutBack  : cubic-bezier(0.680, -0.550, 0.265, 1.550);

// classic
$easeInOut      : cubic-bezier(0.420, 0.000, 0.580, 1.000);

//------------------------------------------------------------------------------
// MAIN CLASSES
//------------------------------------------------------------------------------

.vivify {
    -webkit-animation-duration: .8s;
    -webkit-animation-fill-mode: both;
    animation-duration: .8s;
    animation-fill-mode: both;
}

.infinite {
    -webkit-animation-iteration-count: infinite;
    animation-iteration-count: infinite; 
}

//**********


//------------------------------------------------------------------------------
// SINGLE ANIMATIONS
//------------------------------------------------------------------------------

.pulsate {
    @include name(pulsate); 
    @include transformOrigin(center);
}

@keyframes pulsate {
    0% {
        @include bezier($easeOutQuad);
        @include transform(scale3d(1,1,1));
    }
    50% {
        @include transform(scale3d(.8,.8,.8));
    }
    100% {
        @include bezier($easeInQuart);
        @include transform(scale3d(1,1,1));
    }
}

.blink {
    @include name(blink);
    @include bezier(cubic-bezier(0.420, 0.000, 0.580, 1.000));
    @include duration(1s);
}

@keyframes blink {

    0% {
        opacity: 1;
    }

    25% {
        opacity: 0;
    }

    50% {
        opacity: 1;
    }

    75% {
        opacity: 0;
    }

    100% {
        opacity: 1;
    }

}

.hitLeft {
    @include name(hitLeft);
    @include backFaceVisibility(hidden);
}

@keyframes hitLeft {
    0% {
        @include bezier($easeOutQuint);
        @include transform(translateX(0)); 
    }

    40% {
        @include bezier($easeInSine);
        @include transform(translateX(20px) rotate(4deg));
    }
}

.hitRight {
    @include name(hitRight);
    @include backFaceVisibility(hidden);
}

@keyframes hitRight {
    0% {
        @include bezier($easeOutQuint);
        @include transform(translateX(0)); 
    }

    40% {
        @include bezier($easeInSine);
        @include transform(translateX(-20px) rotate(-4deg));
    }
}

.shake {
    @include name(shake);
    @include duration(1s);
    @include bezier(cubic-bezier(0.420, 0.000, 0.580, 1.000));
}

@keyframes shake {

    10% {
        @include transform(translateX(-10px));
    }
    20% {
        @include transform(translateX(10px));
    }
    30% {
        @include transform(translateX(-10px));
    }
    40% {
        @include transform(translateX(10px));
