//------------------------------------------------------------------------------
// SPIN ANIMATIONS
//------------------------------------------------------------------------------

.spin {
    @include name(spin);
    @include duration(1.2s);
}

@keyframes spin {
    0% {
        @include bezier($easeInQuint);
        @include transform(rotateZ(0deg));
        @include transformOrigin(center center);
    }
    20% {
        @include bezier($easeOutQuart);
        @include transform(rotateZ(-20deg));
        @include transformOrigin(center center);
    }
    70% {
        @include bezier($easeInOut);
        @include transform(rotateZ(380deg));
        @include transformOrigin(center center);
    }
    100% {
        @include bezier($easeInSine);
        @include transform(rotateZ(360deg));
        @include transformOrigin(center center);
    }
}

.spinIn {
    @include name(spinIn);
    @include duration(1s);
}

@keyframes spinIn {
    0% {
        opacity: 0;
        @include bezier($easeOutQuint);
        @include transform(rotateZ(0deg) scale3d(0, 0, 0));
        @include transformOrigin(center center);
    }
    50% {opacity: 1}
    70% {
        @include transform(rotateZ(380deg) scale3d(1, 1, 1));
        @include transformOrigin(center center);
    }
    100% {
        @include transform(rotateZ(360deg) scale3d(1, 1, 1));
        @include transformOrigin(center center);
    }
}

.spinOut {
    @include name(spinOut);
    @include duration(1s);
}

@keyframes spinOut {

    0% {
        @include bezier($easeOutQuint);
        @include transform(rotateZ(0deg) scale3d(1, 1, 1));
        @include transformOrigin(center center);
    }
    20% {
        opacity: 1;
        @include bezier($easeOutQuart);
        @include transform(rotateZ(-20deg) scale3d(1, 1, 1));
        @include transformOrigin(center center);
    }
    30% { opacity: 1; }
    100% {
        opacity: 0;
        @include bezier($easeInSine);
        @include transform(rotateZ(360deg) scale3d(0, 0, 0));
        @include transformOrigin(center center);
    }
}


