//------------------------------------------------------------------------------
// FOLD ANIMATIONS
//------------------------------------------------------------------------------

.fold {
    @include name(fold);
}

@keyframes fold {
    0% {
        @include bezier($easeOutQuad);
        @include transform(scale3d(1,1,1)); 
    }
    30% {
        @include bezier($easeInOutQuad);
        @include transform(scale3d(1,.4,1));  
    }
    60% {
        opacity: 1;
        @include bezier($easeInOutQuad);
        @include transform(scale3d(.4,.4,1)); 
    }
    100% {
        opacity: 0;
        @include bezier($easeInQuad);
        @include transform(scale3d(.2,.2,.2)); 
    }  
}


.unfold {
    @include name(unfold);
}

@keyframes unfold {
    0% {
        opacity: 0;
        @include bezier($easeOutQuad);
        @include transform(scale3d(0,0,0)); 
    }
    30% {
        opacity: 1;
        @include bezier($easeInOutQuad);
        @include transform(scale3d(.4,.4,1));  
    }
    60% {
        @include bezier($easeInOutQuad);
        @include transform(scale3d(.4,1,1)); 
    }
    100% {
        @include bezier($easeInQuad);
        @include transform(scale3d(1,1,1));  
    }  
}


//------------------------------------------------------------------------------
// DELAY CLASSES
//------------------------------------------------------------------------------

@for $i from 1 through 9 {
    .delay-#{$i}#{"00"} { @include delay(#{"."}#{$i}#{"s"}); }
    .delay-#{$i}#{"50"} { @include delay(#{$i}#{"50ms"}); }
    .duration-#{$i}#{"00"} { @include duration(#{"."}#{$i}#{"s"}); }
    .duration-#{$i}#{"50"} { @include duration(#{$i}#{"50ms"}); }
}

@for $i from 1 through 5 {
    .delay-#{$i}#{"000"} { @include delay(#{$i}#{"s"}); }
    .delay-#{$i}#{"250"} { @include delay(#{$i}#{"250ms"}); }
    .delay-#{$i}#{"500"} { @include delay(#{$i}#{".5"}#{"s"}); }
    .delay-#{$i}#{"750"} { @include delay(#{$i}#{"750ms"}); }
    .duration-#{$i}#{"000"} { @include duration(#{$i}#{"s"}); }
    .duration-#{$i}#{"250"} { @include duration(#{$i}#{"250ms"}); }
    .duration-#{$i}#{"500"} { @include duration(#{$i}#{".5"}#{"s"}); }
    .duration-#{$i}#{"750"} { @include duration(#{$i}#{"750ms"}); }
}

@for $i from 6 through 10 {
    .duration-#{$i}#{"000"} { @include duration(#{$i}#{"s"}); }
    .duration-#{$i}#{"250"} { @include duration(#{$i}#{"250ms"}); }
    .duration-#{$i}#{"500"} { @include duration(#{$i}#{".5"}#{"s"}); }
    .duration-#{$i}#{"750"} { @include duration(#{$i}#{"750ms"}); }
}
